import React from "react";
import Landing from "../../components/landing";
import Intro from "../../components/intro";
import Stastep from "../../components/stastep";
import Footer from "../../components/footer";

import STEP1BACK from "../../assets/img/step4-back.png";
import STEP2BACK from "../../assets/img/step5-back.png";
import STEP3BACK from "../../assets/img/step6-back.png";
import "./style.scss";

const seekerdata = {
  title: {
    left: (
      <span>
        3 Step use for Fashion Seeker<br></br>TO BOOK AND CONSULT
      </span>
    ),
    right: (
      <span>
        Book<br></br>FASHION
      </span>
    )
  },
  step1: {
    num: "01",
    title: "Search your Fashionista",
    desc: (
      <span>
        Showcase who you are, your past work and what<br></br> you are looking
        for
      </span>
    ),
    img: STEP1BACK
  },
  step2: {
    num: "02",
    title: "Pay and Book Fashionista",
    desc:
      "Find and get contacted by the most relevant brands for your audience with complete transparency on what they have to offer",
    img: STEP2BACK
  },
  step3: {
    num: "03",
    title: (
      <span>
        Connect easily with<br></br>video and chat
      </span>
    ),
    desc: (
      <span>
        Discuss directly with the influencer and<br></br> agree on the terms of
        the collaboration
      </span>
    ),
    img: STEP3BACK
  }
};

function DefaultFashionseeker() {
  return (
    <div className="home">
      <Landing></Landing>
      <Intro></Intro>
      <Stastep {...seekerdata}></Stastep>
      <Footer></Footer>
    </div>
  );
}

export default DefaultFashionseeker;
